export const SortRoutes: FC = () => {
    // transportation types:
    // 1 - plane
    // 2 - train (I guess) 
    // 3 - car (I guess)

    return (
    <View>
        <Text>SortRoutes</Text>
        <RadioButton.Group style={styles.radioButtonContainer} onValueChange={newValue => console.log(newValue)} value={1}>
            <View>
                <Text>Plane</Text>
                <RadioButton value={"1"} />
            </View>
            <View>
                <Text>Train</Text>
                <RadioButton value={"2"} />
            </View>
            <View>
                <Text>Car</Text>
                <RadioButton value={"3"} />
            </View>
        </RadioButton.Group>


    </View>)
}

const styles = StyleSheet.create({


    radioButtonContainer: {
        flex:1,
        display: "flex",
        flexDirection: "row",
        justifyContent: "space-between",
        alignItems: "center",
        width: "100%",
    },


})
